import React from 'react';
import "./style.scss";
import { Avatar } from 'flowbite-react';

const UserProfile = () => {
    return (
        <div>
            <div className="bg-wallpaper relative">
                <Avatar
                    rounded
                    img="/images/people/profile-picture-5.jpg"
                    size="lg"
                    className="absolute z-300"
                />
            </div>

        </div>
    );
};

export default UserProfile;
